//hereglegch ooriin medeelliig hyanah heseg
import React from "react";
import Layout from "../components/Layout";

export default function account() {
  this.print();
  return (
    <Layout>
      <div>Account</div>
    </Layout>
  );
}

account.prototype.print = () => {
  console.log("printing");
};
